  [],\n\t\"revision_timestamp\": \"2016-02-22T22:07:59.724968\",\n\t\"name\": \"northeast-integrated-pelagic-survey-pc1405\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"During the survey we will quantify the
  spatial distribution of the following parameters: water currents, water properties,
  phytoplankton, microzooplankton, mesozooplankton, pelagic fish and invertebrates,
  sea turtles, marine mammals, and sea birds. We will use traditional and novel techniques
  and instruments. In essence, the approaches of the Ecosystem Monitoring survey and
  the NEFSC Herring Acoustic survey are combined here and augmented to include a broad
  array of measurements of the pelagic ecosystem. Operational objectives are to: (1)
  collect underway data using TSG, SCS, and ADCP; (2) complete CTD and bongo operations
  at stations throughout area, (3) calibrate the EK60 Scientific Sounder, (4) conduct
  acoustic surveys using the EK60, (5) collect biological data to verify species-specific
  acoustic measurements using midwater trawls, (6) collect marine mammal and seabird
  observations.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
